import React, { Component } from 'react';


class ProjectItem extends Component {

  render() {
    // console.log(this.props);
    return (
      <li className="Todo">
      {this.props.todo.title}
      </li>
    );
  }
}

TodoItem.proptypes = {
  todo: React.PropTypes.object

}

export default TodoItem;
